import React, { useState } from 'react';
import { Box, styled } from '@mui/system';
import AutocompleteComboNew from '../material-kit/auto-complete/AutocompleteComboNew';
import { Breadcrumb, SimpleCard } from 'app/components';
import Grid from '@mui/material/Grid';
import SimpleFormNew from '../material-kit/forms/SimpleFormNew';
import { makeStyles } from '@material-ui/styles';
import { Formik } from 'formik';
import * as Yup from 'yup';
import { LoadingButton } from '@mui/lab';
import useAuth from 'app/hooks/useAuth';
import { useNavigate } from 'react-router-dom';

const Container = styled('div')(({ theme }) => ({
  margin: '30px',
  [theme.breakpoints.down('sm')]: { margin: '16px' },
  '& .breadcrumb': {
    marginBottom: '30px',
    [theme.breakpoints.down('sm')]: { marginBottom: '16px' },
  },
}));

const useStyles = makeStyles((theme) => ({
  btn2: {
    marginTop: '10px',
    padding: '7px 23px',
    border: 'none',
    fontSize: '15px',
    color: '#fff',
    background: '#303f9f',
  },
}));

const handleChange = (event) => {
  console.log(event);
};

// inital login credentials
const initialValues = {
  Name: '',
  Type: '',
  port: '',
  Produc_to_buy: '',
  Product_to_get: '',
  Description: '',

  // AttachDocument: '',
  // Note: ''
};

// form field validation schema
const validationSchema = Yup.object().shape({
  Title: Yup.string()
    .min(6, 'Name must be 6 character length')
    .required('Name is required!'),

  Type: Yup.string()
    .min(6, 'Type must be 6 character length')
    .required('Type is required!'),

  port: Yup.string()
    .max(6, 'port must be 4 character length')
    .required('port is required!'),

  Charactersperline: Yup.string()
    .min(6, 'Produc_to_buy must be 6 character length')
    .required('Produc_to_buy per line is required!'),

  IPAddress: Yup.string()
    .min(6, 'Product_to_get must be 6 character length')

    .required('Product_to_get per line is required!'),

  Profile: Yup.string()
    .min(6, 'Description must be 6 character length')
    .required('Description per line is required!'),
});

const Addpromos = (props) => {
  const classes = useStyles();
  const [value, setValue] = useState('Controlled');
  const { register } = useAuth();
  const navigate = useNavigate();
  const [loading, setLoading] = useState(false);
  const [note, setNote] = useState('');
  const handleFormSubmit = (values) => {
    console.log(values);
  };
  return (
    <Container>
      <Box className="breadcrumb">
        <Breadcrumb
          routeSegments={[{ name: 'Material', path: '/material' }, { name: 'Add Promos' }]}
        />
      </Box>
      <SimpleCard>
        <Formik
          onSubmit={handleFormSubmit}
          initialValues={initialValues}
          validationSchema={validationSchema}
        >
          {({ values, errors, touched, handleChange, handleBlur, handleSubmit }) => (
            <form onSubmit={handleSubmit}>
              <Grid container spacing={2}>
                <Grid item xs={12} md={6}>
                  <SimpleFormNew
                    props={{
                      type: 'text',
                      name: 'Name',
                      label: 'Name',
                      onBlur: handleBlur,
                      value: values.Name,
                      onChange: handleChange,
                      helperText: touched.Name && errors.Name,
                      error: Boolean(errors.Name && touched.Name),
                    }}
                  />
                </Grid>
                <Grid item xs={12} md={6}>
                  <AutocompleteComboNew
                    props={{
                      // names: [
                      //   'Oliver Hansen',
                      //   'Van Henry',
                      //   'April Tucker',
                      //   'Ralph Hubbard',
                      //   'Omar Alexander',
                      //   'Carlos Abbott',
                      //   'Miriam Wagner',
                      //   'Bradley Wilkerson',
                      //   'Virginia Andrews',
                      //   'Kelly Snyder',
                      // ],
                      type: 'text',
                      name: 'Type',
                      label: 'Type',
                      onBlur: handleBlur,
                      value: values.Type,

                      onChange: handleChange,
                      helperText: touched.Type && errors.Type,
                      error: Boolean(errors.Type && touched.Type),
                    }}
                  />
                </Grid>
                <Grid item xs={12} md={6}>
                  <AutocompleteComboNew
                    props={{
                      names: [
                        'Oliver Hansen',
                        'Van Henry',
                        'April Tucker',
                        'Ralph Hubbard',
                        'Omar Alexander',
                        'Carlos Abbott',
                        'Miriam Wagner',
                        'Bradley Wilkerson',
                        'Virginia Andrews',
                        'Kelly Snyder',
                      ],
                      name: 'Profile',
                      label: 'Profile',
                      value: values.Profile,
                      onBlur: handleBlur,
                      onChange: handleChange('Profile'),
                      helperText: touched.Profile && errors.Profile,
                      error: Boolean(errors.Profile && touched.Profile),
                    }}
                  />
                </Grid>
                <Grid item xs={12} md={6}>
                  <SimpleFormNew
                    props={{
                      type: 'text',
                      name: 'Produc_to_buy',
                      label: 'Product to buy',
                      onBlur: handleBlur,
                      value: values.Produc_to_buy,
                      onChange: handleChange,
                      helperText: touched.Produc_to_buy && errors.Produc_to_buy,
                      error: Boolean(errors.Produc_to_buy && touched.Produc_to_buy),
                    }}
                  />
                </Grid>
                <Grid item xs={12} md={6}>
                  <SimpleFormNew
                    props={{
                      type: 'text',
                      name: 'Product_to_get',
                      label: 'AddProduct to get',
                      onBlur: handleBlur,
                      value: values.Product_to_get,
                      onChange: handleChange,
                      helperText: touched.Product_to_get && errors.Product_to_get,
                      error: Boolean(errors.Product_to_get && touched.Product_to_get),
                    }}
                  />
                </Grid>
                <Grid item xs={12} md={6}>
                  <SimpleFormNew
                    props={{
                      type: 'text',
                      name: 'Description',
                      label: 'Description',
                      onBlur: handleBlur,
                      value: values.Description,
                      onChange: handleChange,
                      helperText: touched.Description && errors.Description,
                      error: Boolean(errors.Description && touched.Description),
                    }}
                  /> 


                </Grid>



              </Grid>
              <LoadingButton
                variant="contained"
                type="submit"
                loading={loading}
                className={classes.btn2}
              >
                Add Promos
              </LoadingButton>
            </form>
          )}
        </Formik>
      </SimpleCard>
    </Container>
  );
};

export default Addpromos;
